<!DOCTYPE html>
<html>
    <head>
        <title>Authorship stats</title>
        <style>
            th {
                border-bottom: 1px solid #555;
            }

            td:first-child{
                text-align: right;
            }

            span {
                border: 1px solid #777;
                padding: 3px;
                width: 40px;
                color: #444;
                text-align: right;
                display: inline-block;
                font-family: courier;
            }
        </style>
        <script>
            'use strict';

            const run = (minors, people, resolution) => {
                const stats = calcule(minors, people, resolution);

                setHTML('people', humanize(stats.people));
                setHTML('commits', humanize(stats.commits));
                setHTML('avg', Math.round(stats.avg * 10) / 10);
                setHTML('max', humanize(stats.max));
                setHTML('overAvg', humanize(stats.overAvg));
                setHTML('clusterSize', Math.round(stats.clusterSize));
                setHTML('firstPeople', humanize(stats.inFirstCluster));
                setHTML('firstCommits', humanize(stats.histogram[0]));

                plot('myCanvas', stats.histogram);
            };

            const redraw = (minor, people) => () => {
                const cropRight = parseInt(document.getElementById('cropRight').value);
                const resolution = parseInt(document.getElementById('resolution').value);
                const ignoreMinors = document.getElementById('ignoreMinors').checked;

                const newPeople = {};
                let count = Object.keys(people).length - cropRight;
                for (let i in people) {
                    count--;
                    if (count < 0) {
                        break;
                    }

                    newPeople[i] = people[i];
                }

                run(ignoreMinors ? {} : minors, newPeople, resolution)
            };


            const update = (e) => {
                updateLabel(e.target.id)
            };

            const updateLabel = (id) => {
                document.getElementById(id + 'Value').innerHTML = document.getElementById(id).value
            };

            const setInitial = (id, value) => {
                document.getElementById(id).value = value;
                updateLabel(id);
            };

            const humanize = num => {
                if (num >= 1000000) {
                    return Math.round(num / 100000) / 10 + " M";
                } else if (num >= 1000) {
                    return Math.round(num / 100) / 10 + " K";
                }

                return num;
            }

            const plot = (id, data) => {
                const canvas = document.getElementById(id);

                const width = canvas.width;
                const height = canvas.height;
                const maxX = data.length
                const maxY = data.reduce((i, j) => i > j ? i : j)

                const convert = (x, y) => {
                    return [
                        Math.round(x * width / (maxX - 1)),
                        Math.round(height - y * height / (maxY))
                    ];
                }

                const ctx = canvas.getContext("2d"); debugger;
                ctx.clearRect(0, 0, width, height);
                ctx.beginPath();
                ctx.moveTo(0,0);
                data.forEach((v, i) => {
                    const point = convert(i, v);
                    ctx.lineTo(point[0], point[1]);
                });

                ctx.stroke();
            };

            const setHTML = (id, value) => {
                document.getElementById(id).innerHTML = value;
            };

            const calcule = (minors, people, resolution) => {
                let commitsCount = 0;
                let peopleCount = 0;
                let max = 0;
                let inFirstCluster = 0;

                const histogram = [];

                for (let kind in minors) {
                    commitsCount += parseInt(kind) * minors[kind];
                    peopleCount += minors[kind];
                }

                for (let kind in people) {
                    commitsCount += people[kind];
                    peopleCount++;
                    if (max < people[kind]) {
                        max = people[kind]
                    }
                }

                const clusterSize = max / resolution;

                for (let kind in minors) {
                    const pos = Math.floor(parseInt(kind) / clusterSize) ;
                    const prev = histogram[pos] || 0;
                    histogram[pos] = prev + parseInt(kind) * minors[kind];

                    if (parseInt(kind) < clusterSize) {
                        inFirstCluster += minors[kind];
                    }
                }

                for (let kind in people) {
                    const pos = Math.floor(people[kind] / clusterSize) ;
                    const prev = histogram[pos] || 0;
                    histogram[pos] = prev + people[kind];

                    if (people[kind] < clusterSize) {
                        inFirstCluster++;
                    }
                }

                const avg = commitsCount/peopleCount;

                let overAvg = 0;
                for (let kind in people) {
                    if (people[kind] > avg) {
                        overAvg++;
                    }
                }

                return {
                    'people': peopleCount,
                    'commits': commitsCount,
                    'avg': avg,
                    'max': max,
                    'overAvg': overAvg,
                    'clusterSize': clusterSize,
                    'inFirstCluster': inFirstCluster,
                    'histogram': histogram,
                };
            }
        </script>

        <canvas id="myCanvas" width="1300" height="300" style="border:1px solid #d3d3d3;"></canvas>

            </tr>
            <tr><td></td><td></td></tr>
            <tr>
